//Create
using (SqlConnection conn = new SqlConnection(connectionString))
{
    conn.Open()
    string query = ""INSERT INTO tableName (column1, column2, column3) VALUES (@value1, @value2, @value3)""	
    using (SqlCommand cmd = new SqlCommand(query, conn))
    {
        cmd.Parameters.AddWithValue(""@value1"", value1)	
        cmd.Parameters.AddWithValue(""@value2"", value2)	
        cmd.Parameters.AddWithValue(""@value3"", value3)	
        cmd.ExecuteNonQuery()	
    }
}

//Read
using (SqlConnection conn = new SqlConnection(connectionString))
{
    conn.Open()	
    string query = ""SELECT * FROM tableName""	
    using (SqlCommand cmd = new SqlCommand(query, conn))
    {
        using (SqlDataReader reader = cmd.ExecuteReader())
        {
            while (reader.Read())
            {
                //Do something with the data
            }
        }
    }
}

//Update
using (SqlConnection conn = new SqlConnection(connectionString))
{
    conn.Open()	
    string query = ""UPDATE tableName SET column1 = @value1, column2 = @value2, column3 = @value3 WHERE id = @id""	
    using (SqlCommand cmd = new SqlCommand(query, conn))
    {
        cmd.Parameters.AddWithValue(""@value1"", value1)	
        cmd.Parameters.AddWithValue(""@value2"", value2)	
        cmd.Parameters.AddWithValue(""@value3"", value3)	
        cmd.Parameters.AddWithValue(""@id"", id)	
        cmd.ExecuteNonQuery()	
    }
}

//Delete
using (SqlConnection conn = new SqlConnection(connectionString))
{
    conn.Open()	
    string query = ""DELETE FROM tableName WHERE id = @id""	
    using (SqlCommand cmd = new SqlCommand(query, conn))
    {
        cmd.Parameters.AddWithValue(""@id"", id)	
        cmd.ExecuteNonQuery()	
    }
}

using System
using System.Collections.Generic	
using System.Linq	
using System.Text	
using System.Threading.Tasks	

namespace CRUD_CSharp
{
    class Program
    {
        static void Main(string[] args)
        {
            // Create
            Console.WriteLine(""Create"")	
            Console.WriteLine(""Input data"")	
            string data = Console.ReadLine()	
            Console.WriteLine(""Data {0} has been created"", data)	

            // Read
            Console.WriteLine(""Read"")	
            Console.WriteLine(""Data {0} has been read"", data)	

            // Update
            Console.WriteLine(""Update"")	
            Console.WriteLine(""Input new data"")	
            string newData = Console.ReadLine()	
            Console.WriteLine(""Data {0} has been updated to {1}"", data, newData)	

            // Delete
            Console.WriteLine(""Delete"")	
            Console.WriteLine(""Data {0} has been deleted"", newData)	
        }
    }
}
